import React from 'react';
//import logo from './logo.svg';
import './App.css';
import pic1 from './assets/images/img1.png';
import pic2 from './assets/images/img2.jpg';
import pic3 from './assets/images/img3.jpg';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      sliderPosition: 0,
    }
  }

  handleSliderMoving 

  render () {
    return (
      <div className="body">
        <div className="main">
          <div  className="container">
            <div className="btn btnLeft">
              <button>Left</button>
            </div>

            <div className="slider">
              <div className="sliderWrapper">
                <div className="pictureWrapper">
                  <img src={pic1} alt="meow1" />
                </div>

                <div className="pictureWrapper">
                  <img src={pic2} alt="meow1"/>
                </div>
                <div className="pictureWrapper">
                  <img src={pic3} alt="meow3"/>
                </div>
              </div>
            </div>

            <div className="btn btnRight">
              <button>Right</button>
            </div>
          </div>
        </div>
      </div>
    )
  }
}

export default App;
